import React from "react";

function Goal(props) {
  const classes = ["list__item"];
  if (props.goal.comleted) {
    classes.push("completed");
  }
  function checkHandler(event) {
    props.check(props.goal.id);
  }

  return (
    <li className={classes.join(" ")} onDoubleClick={checkHandler} onContextMenu={console.log('asd')}>
      <div>
        <p className="list__title">
          <strong>{props.index + 1}. </strong> {props.goal.value}
        </p>
      </div>
      <div className="list__buttons">
        <button className="check-button" onClick={checkHandler}>
          ✔
        </button>
        <button className="delete-button">✕ </button>
      </div>
    </li>
  );
}

export default Goal;
